import React from "react";
import Container from "react-bootstrap/Container";
import Jumbotron from "react-bootstrap/Jumbotron";
import "../frontend.css";

const Header = () => {
  return (
    <Jumbotron>
      <Container>
        <h2>Emplyoee Directory</h2>
        <br>--</br>
        <h4>Placeholder text</h4>
      </Container>
    </Jumbotron>
  );
};

export default Header;
